import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Formulario from './Formulario';


import './App.css';

const App = () => {
  return (
      <BrowserRouter>
        <Routes>
          <Route path='/' Component={Formulario} />
        </Routes>
      </BrowserRouter>
  );
};

export default App;
